import React, { useEffect, useState } from "react";
import api from "../Api"; // âœ… Corrigido para Api.js na pasta src
import Navbar from "../components/Navbar";
import BookCard from "../components/BookCard";

const AdminDashboard = () => {
  const [books, setBooks] = useState([]);
  const [title, setTitle] = useState("");
  const [author, setAuthor] = useState("");
  const [description, setDescription] = useState("");
  const [cover, setCover] = useState(null);
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState("");

  // âœ… Busca livros do backend
  const fetchBooks = async () => {
    try {
      setLoading(true);
      const res = await api.get("/books/", {
        headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
      });
      setBooks(Array.isArray(res.data) ? res.data : res.data.results || []);
    } catch (err) {
      console.error("âŒ Erro ao buscar livros:", err);
      setMessage("Erro ao buscar livros.");
    } finally {
      setLoading(false);
    }
  };

  // âœ… Adiciona um novo livro
  const handleAddBook = async () => {
    if (!title || !author) {
      setMessage("TÃ­tulo e Autor sÃ£o obrigatÃ³rios.");
      return;
    }

    try {
      setLoading(true);
      const formData = new FormData();
      formData.append("title", title);
      formData.append("author", author);
      formData.append("description", description);
      if (cover) formData.append("cover_image", cover); // campo esperado pelo backend

      await api.post("/books/", formData, {
        headers: {
          "Content-Type": "multipart/form-data",
          Authorization: `Bearer ${localStorage.getItem("token")}`,
        },
      });

      // âœ… Reset dos campos
      setTitle("");
      setAuthor("");
      setDescription("");
      setCover(null);
      setMessage("âœ… Livro adicionado com sucesso!");
      fetchBooks();
    } catch (err) {
      console.error("âŒ Erro ao adicionar livro:", err);
      setMessage("Erro ao adicionar livro.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchBooks();
  }, []);

  return (
    <div className="admin-dashboard" style={{ padding: "20px" }}>
      <Navbar />
      <h2 tabIndex="0" style={{ color: "#004999", textAlign: "center" }}>
        ðŸ“š Dashboard do Administrador
      </h2>

      {message && <p tabIndex="0" style={{ textAlign: "center" }}>{message}</p>}

      {/* FormulÃ¡rio para adicionar livro */}
      <section aria-label="Adicionar Livro" style={{ marginBottom: "30px" }}>
        <h3 tabIndex="0">Adicionar Livro</h3>
        <input
          placeholder="TÃ­tulo"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
          aria-label="TÃ­tulo do livro"
        />
        <input
          placeholder="Autor"
          value={author}
          onChange={(e) => setAuthor(e.target.value)}
          aria-label="Autor do livro"
        />
        <textarea
          placeholder="DescriÃ§Ã£o"
          value={description}
          onChange={(e) => setDescription(e.target.value)}
          aria-label="DescriÃ§Ã£o do livro"
        />
        <input
          type="file"
          onChange={(e) => setCover(e.target.files[0])}
          aria-label="Imagem de capa do livro"
        />
        <button onClick={handleAddBook} disabled={loading}>
          {loading ? "Salvando..." : "Adicionar"}
        </button>
      </section>

      {/* Lista de livros */}
      <section aria-label="Acervo de Livros">
        <h3 tabIndex="0">Acervo</h3>
        {loading && <p tabIndex="0">Carregando livros...</p>}
        <div className="book-grid" style={{ display: "grid", gap: "20px" }}>
          {books.length > 0 ? (
            books.map((book) => (
              <BookCard key={book.id} book={book} refreshBooks={fetchBooks} />
            ))
          ) : (
            <p>Nenhum livro encontrado.</p>
          )}
        </div>
      </section>
    </div>
  );
};

export default AdminDashboard;
